import React, { Component } from 'react';
import { MDBRow, MDBCol } from 'mdb-react-ui-kit';

export default class EntityGroupHeader extends React.Component {

    render() {
        return(
            <MDBRow className="head-group">
                <MDBCol md="2" className="head">
                    Initiative
                </MDBCol>
                <MDBCol md="4" className="head">
                    Name
                </MDBCol>
                <MDBCol md="2" className="head">
                    Health
                </MDBCol>
                <MDBCol md="2" className="head">
                    AC
                </MDBCol>
            </MDBRow>
        )
    }
}
